import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'my-portfolio';
}
<div class="row">
  <div class="col-8"><app-header></app-header></div>
  <div class="col-4">col-4</div>
</div>
